import NavBar from "../Component/navbar";

export const DashBoard = () => {
    return (
        <>
            <Box sx={{display: "flex"}}>
                <Box>
                    <NavBar />
                    <h1>hi</h1>
                </Box>

                <Box sx={{top: "400px"}}>
                    I LOVE YOU AASU
                </Box>
            </Box>
        </>

    )
};
